import React, { useState } from 'react';
import './SignInPage.css';

function TotalInfo() {
  const [salutation, setSalutation] = useState('');
  const [fullName, setFullName] = useState('');
  const [dob, setDob] = useState('');
  const [password, setPassword] = useState('');
  const [errorMessages, setErrorMessages] = useState({
    salutation: '',
    fullName: '',
    dob: '',
    password: '',
  });

  const validateField = (fieldName, value, regex, errorMessage) => {
    if (!value || (regex && !regex.test(value))) {
      setErrorMessages((prevErrors) => ({
        ...prevErrors,
        [fieldName]: errorMessage,
      }));
      return false;
    } else {
      setErrorMessages((prevErrors) => ({ ...prevErrors, [fieldName]: '' }));
      return true;
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const isValid = validateInputs();

    if (isValid) {
      console.log('Form submitted:', {
        salutation,
        fullName,
        dob,
        password,
      });
      // Simulate navigation to the success page
      window.location.href = '/success';
    } else {
      console.log('Form submission failed. Please check the fields.');
    }
  };

  const validateInputs = () => {
    const nameRegex = /^[A-Za-z][A-Za-z. ]{1,18}[A-Za-z. ]$/;
    const dobRegex = /^(0[1-9]|1[0-2])\/(0[1-9]|[12][0-9]|3[01])\/\d{4}$/;
    const passwordRegex = /^(?=.*[A-Za-z])(?=.*\d)(?=.*[@$!%*#?&])[A-Za-z\d@$!%*#?&]{8,}$/;

    let isValid = true;

    isValid = isValid && validateField('salutation', salutation, null, 'Please select a salutation.');
    isValid = isValid && validateField('fullName', fullName, nameRegex, 'Please enter a valid full name as per PAN card.');
    isValid = isValid && validateField('dob', dob, dobRegex, 'Please enter a valid date of birth in the format dd/mm/yyyy.');
    isValid = isValid && validateField(
      'password',
      password,
      passwordRegex,
      'Password must be at least 8 characters, contain at least one letter, one number, and one special character.'
    );

    return isValid;
  };

  const handleInputChange = (fieldName, value, regex, errorMessage) => {
    if (fieldName === 'salutation') {
      setSalutation(value);
    } else if (fieldName === 'fullName') {
      setFullName(value);
    } else if (fieldName === 'dob') {
      setDob(value);
    } else if (fieldName === 'password') {
      setPassword(value);
    }

    validateField(fieldName, value, regex, errorMessage);
  };

  return (
    <div className='org1'>
      <h2>Sign In for Here</h2>
      <form className='forinner1 container' onSubmit={handleSubmit}>
        <div className='form-group1 container'>
          <div>Salutation:</div>
          <div className='form-group1Input container'>
            <select
              value={salutation}
              onChange={(e) => handleInputChange('salutation', e.target.value, null, 'Please select a salutation.')}
            >
              <option value=''>Select</option>
              <option value='Mr'>Mr</option>
              <option value='Mrs'>Mrs</option>
              <option value='Ms'>Ms</option>
            </select>
            <p className='error-message1'>{errorMessages.salutation}</p>
          </div>
        </div>

        <div className='form-group1 container'>
          <div>Full Name (As per Pancard):</div>
          <div className='form-group1Input container'>
            <input
              type='text'
              className=''
              placeholder='ex: Full Name'
              value={fullName}
              onChange={(e) => handleInputChange('fullName', e.target.value, /^[A-Za-z][A-Za-z. ]{1,18}[A-Za-z. ]$/, 'Please enter a valid full name as per PAN card.')}
            />
            <p className='error-message1'>{errorMessages.fullName}</p>
          </div>
        </div>

        <div className='form-group1 container'>
          <div>Date of Birth (As per Pancard):</div>
          <div className='form-group1Input container'>
            <input
              type='text'
              className=''
              placeholder='ex: dd/mm/yyyy'
              value={dob}
              onChange={(e) => handleInputChange('dob', e.target.value, /^(0[1-9]|1[0-2])\/(0[1-9]|[12][0-9]|3[01])\/\d{4}$/, 'Please enter a valid date of birth in the format dd/mm/yyyy.')}
            />
            <p className='error-message1'>{errorMessages.dob}</p>
          </div>
        </div>

        <div className='form-group1 container'>
          <div>Password:</div>
          <div className='form-group1Input container'>
            <input
              type='password'
              className=''
              placeholder='ex: Abc@123'
              value={password}
              onChange={(e) => handleInputChange('password', e.target.value, /^(?=.*[A-Za-z])(?=.*\d)(?=.*[@$!%*#?&])[A-Za-z\d@$!%*#?&]{8,}$/, 'Password must be at least 8 characters, contain at least one letter, one number, and one special character.')}
            />
            <p className='error-message1'>{errorMessages.password}</p>
          </div>
        </div>

        <button className='btn btn-success my-2' type='submit'>
          Sign In
        </button>
      </form>
    </div>
  );
}

export default TotalInfo;
